Mongodb C# - Registering class maps with generics works, where using types fails<p>I have a collection of objects, and each object has a property, EventData, that is many different types. These types all inherit from an <code>IEventData</code> interface.</p>
<p>For example:</p>
<pre><code>{ _id: '...', EventData: { _t: 'TypeA', ... } }
{ _id: '...', EventData: { _t: 'TypeB', ... } }
</code></pre>
<p>I'm currently facing an issue with the MongoDB C# driver when trying to register class maps.
When using the generic version to register the class map, the EventData object is correctly serialised with all properties and the type discriminator:</p>
<pre><code>BsonClassMap.RegisterClassMap&lt;TypeA&gt;();
// Full event data is written to collection
// { _id: '...', EventData: { _t: 'TypeA', InterfaceProperty: '...', ClassProperty: '...' } }
</code></pre>
<p>This works fine, however I have a large amount of different event types, and want to try and use some reflection to help automate this. When trying to use the non-generic version of the RegisterClassMap whilst iterating over all types that implement the IEventData interface, only the interface members are serialised:</p>
<pre><code>var types = AppDomain.CurrentDomain.GetAssemblies()
.SelectMany(i =&gt; i.GetTypes())
.Where(t =&gt; typeof(IEventData).IsAssignableFrom(t));

foreach (var type in types)
{
    // If it's an interface, skip as we can't register those
    if (type.IsInterface)
        continue;

